import { useState } from "react";

export default function TimeDaData() {
    const [dataSelecionada, setDataSelecionada] = useState('');
    
    return(
        <div className='datatime'>
          <label>Data:</label>
          <input
            className='datainput'
            type="date"
            value={dataSelecionada}
            onChange={(e) => setDataSelecionada(e.target.value)}
          />
        </div>
    )
}
